import porfolioPessoal from './images/thumbnail_teste.jpeg';
import faceClone from './images/thumbnail_teste2.jpeg';

const frontEnd = 'Front End'

const lucasProjects = [
  {
    name: 'Portfólio Pessoal',
    thumb: porfolioPessoal,
    type: frontEnd,
  },
  {
    name: 'Facebook Clone',
    thumb: faceClone,
    type: frontEnd,
  },
];

export default lucasProjects;
